// #fancyBox v3.1.28
function ll(){
	var ll = new LazyLoad({
		elements_selector: "img[data-src],iframe[data-src],[data-bg]"
	});	
	$(document).ajaxComplete(function(event, xhr, settings) {
		ll.update();
	});
}
function trihoan_css(_stylesheet,id = ''){
	var stylesheet = document.createElement('link');
	stylesheet.href = _stylesheet;
	stylesheet.rel = 'stylesheet';
	stylesheet.type = 'text/css';
	if (id) {
		stylesheet.setAttribute('id',id);
	}
	document.getElementsByTagName('head')[0].appendChild(stylesheet);
}

function trihoan_js( url, callback, id = '' ) {
	var script = document.createElement( "script" )
	script.type = "text/javascript";
	if(script.readyState) {
		script.onreadystatechange = function() {
			if ( script.readyState === "loaded" || script.readyState === "complete" ) {
				script.onreadystatechange = null;
				if (typeof callback == "function") {
					callback();
				}
			}
		};
	} else {
		if (typeof callback == "function") {
			script.onload = function() {
				callback();
			};
		}
	}

	script.src = url;
	if (id) {
		script.setAttribute('id',id);
	}
	document.getElementsByTagName( "head" )[0].appendChild( script );
}

function search(){
	$("#form-search").submit(function(event) {
		event.preventDefault();
		var keywords = $(this).find('.txt_keywords');
		var h = '';
		if (keywords.val()) {
			h += '&keywords='+keywords.val();
			window.location.href = 'tim-kiem'+h;
		} else {
			alert('Vui lòng nhập từ khóa tìm kiếm');
		}
	});
}
function backtotop(){
	var top = $('#back_to_top');
	$(window).scroll(function(){
		if($(window).scrollTop() > 300){
			top.fadeIn(200);
		} else {
			top.fadeOut(300);
		}					
	});
	top.on('click',function(){
		$('html, body').animate({scrollTop:0}, 'slow');
	});
}
function sticky_menu(){
	$(window).scroll(function(event) {
		if($(window).scrollTop() >= $("#fix").offset().top){
			$(".block-menu").addClass('sticky');
		} else{
			$(".block-menu").removeClass('sticky');
		}
	});
}
function menu_mobile(){
	var $el = $("#clone").clone(true);
	$el.removeAttr('id').removeClass('on-d').addClass('mm-menu mm-offcanvas').attr('id','mmenu');
	$el.find('#home').find("a").text('Trang chủ');
	$el.find('*').removeAttr('class').removeAttr('id');			
	$("#hide-menu").html($el);
	$("#mmenu").mmenu();
}
function detect_responsive(){
	var flag = true;
	$(window).bind('load resize', function(event) {
		if ($(window).innerWidth() < 1201 && flag) {
			trihoan_css('css/mmenu.css');
			trihoan_js('js/mmenu.js',menu_mobile);
			flag = false;
		}
	});
}
$(function() {
	sticky_menu();
	detect_responsive();
	backtotop();
	ll();
	search();
	trihoan_css('css/font-awesome.min.css');
	less.pageLoadFinished.then(function(){
		new WOW().init();
		$(".slick-banner").slick({
			slidesToShow: 1,
			slidesToScroll:1,
			arrows:false,
			dots:false,
			autoplay:true,
			autoplaySpeed:3000,
			speed:500
		});
		$(".slick-tin-tuc").slick({
			slidesToShow: 3,
			slidesToScroll:1,
			arrows:false,
			dots:false,
			autoplay:false,
			autoplaySpeed:3000,
			speed:500,
			vertical: true,
			verticalSwiping: true
		});
		$(".slick-y-kien-khach-hang").slick({
			slidesToShow: 1,
			slidesToScroll:1,
			arrows:true,
			prevArrow: '<span class="Prev"><i class="fa fa-2x fa-angle-left" aria-hidden="true"></i></span>',
			nextArrow: '<span class="Next"><i class="fa fa-2x fa-angle-right" aria-hidden="true"></i></span>',
			dots:false,
			autoplay:true,
			autoplaySpeed:3000,
			speed:500
		});
	});
});